import * as React from 'react';
import pic from '../../images/beauty-products.jpg';

const Top = () => {
    return (
       <header>
         <div className="navbar navbar-dark bg-dark shadow-sm">
          <div className="container">
            <strong className="navbar-brand d-flex align-items-center">Github Job Search</strong>
          </div>
         </div>
       </header>
    )
}

export default Top;
